class Solution {
    func minOperations(_ nums: [Int], _ k: Int) -> Int {
        let xorResult = nums.reduce(0, ^) ^ k
        if xorResult == 0 { return 0 }

        var bitCounts = Array(repeating: 0, count: 32)
        for num in nums {
            for i in 0..<32 where (num >> i) & 1 == 1 {
                bitCounts[i] += 1
            }
        }

        var operations = 0
        for i in 0..<32 {
            if (xorResult >> i) & 1 == 1 {
                if bitCounts[i] > 0 {
                    return operations + 1
                } else {
                    operations += 1
                }
            }
        }

        return -1
    }
}
